// Holen des Werts von "event_type" aus dem JSON-Objekt
const url = $json.payload.scheduled_event.event_type;

// Extrahieren der UUID am Ende der URL
const extractedCode = url.split('/').pop();

return {
    data: extractedCode
};

/************************************************************************
 * 1)  Ausgang: internal_note aufbereiten
 ************************************************************************/
const raw = item.json.resource?.internal_note ?? '';

const note = raw
  .normalize('NFC')          // Unicode vereinheitlichen
  .replace(/\s+/g, ' ')      // Mehrfach-Spaces → 1 Space
  .trim()
  .toLowerCase();            // alles klein

/************************************************************************
 * 2)  Helfer zum Erstellen von Vergleichsfunktionen
 ************************************************************************/
const makeEquals = (pattern) => {
  const target = pattern
    .replace(/\s+/g, ' ')
    .toLowerCase();
  return (txt) => txt === target;
};

const makeContains = (pattern) => {
  /* 1. Sonderzeichen escapen, 2. jedes Space zu \s*      (nach dem Escapen,
     damit \s* NICHT wieder “entschärft” wird) */
  const esc = pattern.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');
  const rx  = new RegExp(
    esc.replace(/\\?\s+/g, '\\s*'),   // Leerzeichen flexibel
    'i'
  );
  return (txt) => rx.test(txt);
};

/************************************************************************
 * 3)  Regel-Tabelle     [ key , herkunft , vergl-Typ , pattern ]
 ************************************************************************/
const RULES = [
  ['Göttinnen Mentoring - VSL',      '💎 Göttinnen Mentoring',           'equals',    'Göttinnen Mentoring - VSL'],
  ['Göttinnen Mentoring Webseite',   '💎 Göttinnen Mentoring Webseite',  'equals',    'type=Setting Call&Göttinnen Mentoring - Webseite'],
  ['Social Chronicles - Webseite',   '📱 SM Evergreen Webseite',         'equals',    'Social Chronicles - Webseite'],
  ['Social Chronicles - Setting LIVE Webinar','📱 SM Evergreen',        'equals',    'Social Chronicles - Setting LIVE Webinar'],
  ['Social Chronicles - Evergreen-Webinar','📱 SM Evergreen',           'equals',    'Social Chronicles - Evergreen-Webinar'],
  ['Affiliate',                      '🤝 Affiliate',                     'contains',  'Affiliate'],
  ['Outbound',                       '📞 Outbound',                      'contains',  'Outbound'],
  ['Paid Masterclass',               '📀 Paid Masterclass',              'contains',  'Paid Masterclass'],
  ['Buch Funnel',                    '📖 🎁 Buch Geschenk',              'contains',  'Buch Funnel'],
  ['Content Cash Cow',               '💰 Booster Call',                  'contains',  'Content Cash Cow'],
  ['Support',                        '🛠️ Support',                      'contains',  'Support'],
  ['Interview Funnel',               '🎤 Mia Interview',                'contains',  'Interview Funnel'],
  ['Personality E-Mail Flow',        '📰 Newsletter Pitch',              'contains',  'Personality E-Mail Flow'],
  ['Soul of Woman',                  '💎 SOWC',                          'contains',  'Soul of Woman'],
  ['Skool',                          '💬 Skool DOSM',                    'contains',  'Skool'],
  ['DOSM',                           '💬 Skool DOSM',                    'contains',  'type=Setting Call&DOSM'],
  ['Göttinnen Mentoring Typeform',   '💎 Göttinnen Mentoring Typeform',  'equals',    'Göttinnen Mentoring - Typeform'],
  ['GM Quiz Funnel Score',           '☯️ Quiz Funnel ARTEMIS',           'equals',    'type=Setting Call&GM Quiz Funnel Score'],

  /* ----- Linktree: egal ob mit/ohne “ Call ”, egal wie viele Spaces ----- */
  ['Linktree',                       '🐾 Linktree',                      'contains',  'type=Setting Call&Funnel=Linktree'],
  ['Linktree',                       '🐾 Linktree',                      'contains',  'type=Setting&Funnel=Linktree'],

  /* ---------------------------------------------------------------------- */
  ['Newsletter',                     '📰 Newsletter Pitch',              'contains',  'type=Setting&Newsletter-Pitch'],
  ['Newsletter',                     '📰 Newsletter Pitch',              'contains',  'type=Setting&Newsletter-Reply'],
  ['IG-DM',                          '💬 IG DM',                         'contains',  'type=Setting&DOSM-IG-DM'],
  ['IG-DM',                          '💬 IG DM',                         'contains',  'type=Setting&MIA-IG-DM'],
  ['SOW VSL',                        '💎 SOWC',                          'equals',    'type=Setting Call&SOW VSL'],
  ['Founder Summit',                 '🏦 Founder Summit 2025',           'equals',    'type=Setting&Founder-Summit'],
  ['GM 1o1 Bewerbung',               '💎 GM 1o1 Bewerbung',              'equals',    'type=Setting Call&Göttinnen Mentoring 1o1 Bewerbung']
];

/************************************************************************
 * 4)  Erste zutreffende Regel anwenden
 ************************************************************************/
let productKey = 'Unknown';
let herkunft   = '🤷‍♂️ Unbekannt';

for (const [k, h, typ, pat] of RULES) {
  const hit = (typ === 'equals' ? makeEquals(pat) : makeContains(pat))(note);
  if (hit) {
    productKey = k;
    herkunft   = h;
    break;
  }
}

/************************************************************************
 * 5)  Ergebnis ans Item hängen und zurückgeben
 ************************************************************************/
item.json.productKey               = productKey;
item.json['Setting Call Herkunft'] = herkunft;

return item;
